import * as React from "react";
import Svg, { Rect, Path } from "react-native-svg";
function SvgDivideSquare(props) {
    return (<Svg width="1em" height="1em" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth={2} strokeLinecap="round" strokeLinejoin="round" {...props}>
      <Rect x={3} y={3} width={18} height={18} rx={2} ry={2}/>
      <Path d="M8 12h8M12 16h0M12 8h0"/>
    </Svg>);
}
export default SvgDivideSquare;
